const dummy = [
  {
    boardName: '자유게시판',
    boardLink: 'free',
    postList: [
      {
        postTitle: '게시물1',
      },
      { postTitle: '게시물2' },
    ],
  },
  {
    boardName: '유자게시판',
    boardLink: 'yuzu',
    postList: [
      {
        postTitle: '게시물1',
      },
      { postTitle: '게시물2' },
    ],
  },
];

function Main() {
  fetch('http://127.0.0.1:3000/', { method: 'GET' })
    .then((res) => {
      res.json();
    })
    .then((data) => {
      console.log(data);
    });

  return (
    <div>
      메인 페이지 입니다!
      {dummy.map((element) => {
        return (
          <div>
            <div>{element.boardName}</div>
            <div>{element.boardLink}</div>
            <div>
              {element.postList.map((ele, index) => {
                return <div key={index}>{ele.postTitle}</div>;
              })}
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Main;
